window.bookSummaryJSON = "<p>Packed full of fun and adventure with Winnie-the-Pooh and all his friends in the Hundred Acre Forest. This is a wonderful dramatisation of <i>The House at Pooh Corner</i> by David Benedictus with music composed, directed and played by John Gould. With a cast of carefully-chosen actors, this adaptation conveys all the magic of Milne's classic stories.</p> <p>Performed by incredible talent including Finty Williams, Stephen Fry, Sandi Toksvig, Robert Daws, Jane Horrocks, Geoffrey Palmer and Judi Dench, this classic Winnie the Pooh audiobook is perfect for keeping little ones entertained.</p> <p>For more amazing audio books featuring Pooh, Piglet, Tigger, Eeyore and other favourite friends, try:</p> <p><i>Winnie the Pooh: Tigger Comes To The Forest &amp; Other Stories </i></p> <p><i>Winnie the Pooh: Piglet Meets a Heffalump</i></p> <p><i>Winnie the Pooh: Pooh Invents a New Game and Other Stories </i></p> <p></p>"; 
